import React, { useState } from "react";
import ReactDOM from "react-dom";
import "./index.css";

const Set=()=>{
  
  const M=new Date().getTime();
  const state = useState();
  let [count,setCount] = useState(0);
  
const Inn=() => {
  setCount(M);
};
   
  return (
  <>
      <h1>{count}</h1>
      <button onClick={Inn}>tap on</button>
  </>
  );





 }




ReactDOM.render(
   <>
   <Set />
   </>
 
  ,document.getElementById("root"));
